ogScale"},{"attributes":{"args":{"alphas":[0.4,0.4,0.8],"glyphs":[{"id":"2875"},{"id":"2883"},{"id":"2891"}],"legends":[{"id":"2877"},{"id":"2885"},{"id":"2893"}]},"code":"\nconst nglyphs = glyphs.length;\nvar some = 0;\nfor (let nn = 0; nn &lt; nglyphs; nn++) {\n    var glyph = glyphs[nn];\n    var source = glyph.data_source;\n    var legend = legends[nn];\n    \n    if (!glyph.visible){\n        source.selected.indices = [];\n    }\n\n    if (source.selected.indices.length == 0){\n        glyph.glyph.line_alpha = glyph.nonselection_glyph.line_alpha;\n        glyph.glyph.fill_alpha = glyph.nonselection_glyph.fill_alpha;\n        glyph.change.emit();\n    }\n    else {\n        glyph.glyph.line_alpha = alphas[nn];\n        glyph.glyph.fill_alpha = alphas[nn];\n        glyph.change.emit();\n        some = 1;\n    }\n    var newnum = source.selected.indices.length.toLocaleString('en-US');\n    newnum = '(' + newnum + ')';\n    var newstr = legend.label['value'].replace(/\\([\\d,]+\\)/, newnum);\n    legend.label['value'] = newstr;\n}\nif (some == 0){\n    for (let nn = 0; nn &lt; nglyphs; nn++) {\n        var glyph = glyphs[nn];\n        var source = glyph.data_source;\n        var legend = legends[nn];\n        \n        glyph.glyph.line_alpha = alphas[nn];\n        glyph.glyph.fill_alpha = alphas[nn];\n        glyph.change.emit();\n        \n        var newnum = source.data['planet'].length.toLocaleString('en-US');\n        newnum = '(' + newnum + ')';\n        var newstr = legend.label['value'].replace(/\\([\\d,]+\\)/, newnum);\n        legend.label['value'] = newstr;\n    }\n}\n"},"id":"2926","type":"CustomJS"},{"attributes":{"label":{"value":"Confirmed with Mass Measurement (123)"},"renderers":[{"id":"2891"}]},"id":"2893","type":"LegendItem"},{"attributes":{"button_type":"primary","icon":null,"js_event_callbacks":{"button_click":[{"id":"2921"}]},"label":"Download CSV of Selected Data"},"id":"2920","type":"Button"},{"attributes":{"fill_alpha":{"value":0.07},"fill_
